d) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2125610","type":"CustomJS"},{"attributes":{"coordinates":null,"group":null,"line_color":"#666666","line_dash":[6],"location":0},"id":"2125445","type":"Span"},{"attributes":{"axis":{"id":"2125567"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"2125570","type":"Grid"},{"attributes":{"dimensions":"width"},"id":"2125243","type":"PanTool"},{"attributes":{},"id":"2125485","type":"ResetTool"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.1},"fill_color":{"field":"inc","transform":{"id":"2125261"}},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"top":{"field":"Open"},"width":{"value":0.8},"x":{"field":"index"}},"id":"2125529","type":"VBar"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"2125505"},"group":null,"major_label_policy":{"id":"2125674"},"minor_
